class Solution:
    def maximumHappinessSum(self, happiness, k: int) -> int:
        max_count, counter = 0, 0
        needed_arr = sorted(happiness)
        while k > 0:
            max_count += needed_arr[-1]
            #print(max_count)
            counter += 1
            k -= 1
            needed_arr.pop()
            if needed_arr:
                if  needed_arr[-1] > 0:
                    needed_arr[-1] -= counter
                    if needed_arr[-1] <= 0:
                        break
                else:
                    break
        return max_count
    
